import React from 'react';

const Ocard = ({subject,icon,number,direction,percent,percentColor,smallText,largeText,bg,onHover}) => {
    return(
        <div className='ocard' style={{background:bg}} onMouseOver={onHover}>
            <div className='firstRow'>
                <p style={{color:smallText}}>
                {subject}
                </p>
                <img src={icon}/>
            </div>
            <div className='secondRow'>
            <h1 style={{color:largeText}}>{number}</h1>
            <div className='percent'>
                <img src={direction}/>
                <p style={{color:percentColor}}>{percent}</p>
            </div>
            </div>
        </div>
    )
}

export default Ocard;
